package com.company.swordoffer;

import java.util.HashMap;
import java.util.Map;

public class P017_Min_Str_Contains_Str {
    public static void main(String[] args) {
        String s1 = "ADOBECODEBANC";
        String t1 = "ABC";

        String s2 = "a";
        String t2 = "a";

        String s3 = "cabwefgewcwaefgcf";
        String t3 = "cae";

        String s4 = "";
        String t4 = "";


        //System.out.println(minWindow(s1, t1));
        //System.out.println(minWindow(s2, t2));
//        System.out.println(minWindow(s3, t3));

        long ts1 = System.currentTimeMillis();
        System.out.println(minWindow(s4, t4));
        long ts2 = System.currentTimeMillis();
        System.out.println(ts2 - ts1);
    }

    public static String minWindow(String s, String t) {
        // 遍历s，找到第一个属于t的字母，然后以此开始遍历，找到t中的都在s中找到，记录长度。

        // 寻找在t中的元素，可以建立t的哈希表，记录数量。 或者数组，出现的字母统计次数。
        // 遍历s，命中时，则寻找到。

        // 如何判定以i开头的字符串已经包含t？
        // 建立辅助集合，当发现匹配字符时，辅助集合移除该成员。当集合大小为0时，匹配结束。当前的i到j即为包括t的s的子串。

        int m = s.length();
        int n = t.length();

        if (m < n) {
            return "";
        }

        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < n; i++) {
            char c = t.charAt(i);
            if (map.containsKey(c)) {
                map.put(c, map.get(c) + 1);
            } else {
                map.put(c, 1);
            }
        }

        int minIndex = 0;
        int minLen = Integer.MAX_VALUE;

        for (int i = 0; i <= m - n; i++) {
            System.out.println(i);
            char c = s.charAt(i);
            if (map.containsKey(c)) {
                // 匹配到一个字母，开始检索
                Map<Character, Integer> map1 = new HashMap<>(map);

                for (int j = i; j < m; j++) {
                    char c2 = s.charAt(j);
                    if (map1.containsKey(c2)) {
                        int num2 = map1.get(c2);
                        if (num2 == 1) {
                            map1.remove(c2);
                        } else {
                            map1.put(c2, num2 - 1);
                        }
                    }

                    if (map1.size() == 0) {
                        // 使用 j - i + 1的值，更新min
                        int len = j - i + 1;

                        if (len < minLen) {
                            minLen = len;
                            minIndex = i;
                        }
                    }
                }
            }
        }

        if (minLen != Integer.MAX_VALUE) {
            return s.substring(minIndex, minIndex + minLen);
        } else {
            return "";
        }
    }
}
